import React from "react";
import "../../index.css";

const ButtonFooter = ({ changeFilter, title, filter, filterExpValue,fetchData}) => {
  return (
    <button
      className={filterExpValue === filter ? "selectedButton" : "footerButton"}
      onClick={changeFilter.then(fetchData)}
    >
      {title}
    </button>
  );
};

export default ButtonFooter;
